import React from "react";
import yaml from "js-yaml";

class Konumlar extends React.Component {
  state = {
    konumlar: [],
  };

  componentDidMount() {
    this.fetchKonumlar();
  }

  fetchKonumlar = async () => {
    try {
      const response = await fetch("konumlar.yaml");
      const data = await response.text();
      const parsedData = yaml.load(data);
      const konumlar = Object.values(parsedData).filter(
        (value) => typeof value === "string"
      );
      this.setState({ konumlar });
    } catch (error) {
      console.log("Hata: ", error);
    }
  };

  render() {
    const { konumlar } = this.state;

    return (
      <div>
        <h1>Konumlar</h1>
        <ul>
          {konumlar.map((konum, index) => (
            <li key={index}>{konum}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Konumlar;
